import React, { Component } from 'react';
import SplitPane from 'react-split-pane';
import AceEditor from "react-ace";
import 'bootstrap/dist/css/bootstrap.css';
import { Container, Row, Col, Tab, Nav, Button } from "react-bootstrap";

import '../styles/styles.css';

import "ace-builds/src-noconflict/mode-python";
import "ace-builds/src-noconflict/theme-xcode";

function changeValue(newValue) {
    console.log("change", newValue);
}

export default class Questions extends Component {
    render(){
        const { questions, loading } = this.props;
        const { question_id, 
            description,                     
            testcase_input_1,
            testcase_output_1,
            testcase_input_2,
            testcase_output_2
        } = questions;

        if (loading) {
            return <h2>Loading...</h2>
        }

        return (
            <div className='container'>
                {questions.map(quest => {
                const { question_id, 
                    description,                     
                    testcase_input_1,
                    testcase_output_1,
                    testcase_input_2,
                    testcase_output_2
                } = quest;
                return (
                    <SplitPane
                    split='vertical'
                    defaultSize='45%'
                    minSize={400}
                    maxSize={900}
                    >
                        <div class="problem-section">
                            <h1 class="quest-title">Bài {question_id}</h1>
                            <p class="content">{description}</p>
                        </div>      
                        <div class="right">
                            <div class="editor-section">
                                <AceEditor
                                    placeholder="Enter your code here"
                                    mode="python"
                                    theme="xcode"
                                    name="code-editer"
                                    onChange={changeValue}
                                    fontSize={14}
                                    showPrintMargin={true}
                                    showGutter={true}
                                    highlightActiveLine={true}
                                    editorProps={{ $blockScrolling: false }}
                                    style={{width: '100%', height: '100%'}}
                                    value={``}
                                    setOptions={{
                                        enableBasicAutocompletion: true,
                                        enableLiveAutocompletion: true,
                                        enableSnippets: true,
                                        showLineNumbers: true,
                                        tabSize: 4,
                                    }}
                                />
                            </div>
                            <div class="testcase-section">
                                <Container>
                                    <Row>
                                        <Col>
                                            <div class="test-title">TEST CASE</div>
                                        </Col>
                                        <Col style={{textAlign: 'right'}}>
                                            <Button variant="primary" type="submit">Run code</Button>
                                        </Col>
                                    </Row>
                                </Container>

                                <Tab.Container id="testcase-tabs" defaultActiveKey="first">
                                    <Row>
                                        <Col sm={4}>
                                            <Nav variant="pills" className="flex-column">
                                                <Nav.Item>
                                                    <Nav.Link eventKey="first">
                                                        Testcase 1
                                                    </Nav.Link>
                                                </Nav.Item>
                                                <Nav.Item>
                                                    <Nav.Link eventKey="second">
                                                        Testcase 2
                                                    </Nav.Link>
                                                </Nav.Item>
                                            </Nav>
                                        </Col>
                                        <Col sm={8} id="test-content">
                                            <Tab.Content>
                                                <Tab.Pane eventKey="first" >
                                                    <p>Input:</p>
                                                    <p>{testcase_input_1}</p>
                                                    <p>Expected Output:</p>
                                                    <p>{testcase_output_1}</p>
                                                    <p>Actual Output:</p>
                                                    <p>Result:</p>
                                                </Tab.Pane>
                                                <Tab.Pane eventKey="second">
                                                    <p>Input:</p>
                                                    <p>{testcase_input_2}</p>
                                                    <p>Expected Output:</p>
                                                    <p>{testcase_output_2}</p>
                                                    <p>Actual Output:</p>
                                                    <p>Result:</p>
                                                </Tab.Pane>
                                            </Tab.Content>
                                        </Col>
                                    </Row>
                                </Tab.Container>
                            </div>
                        </div>
                    </SplitPane>
                )})}
            </div>
        )
    }
}
